(392, 'itati fabiana brite', '3624-722059', 'fitbybrite@gmail.com', 'Buenos días por el presente quería hacerles saber acerca de mi opinión acerca del ´Curso de acompañamiento a los procesos de jubilación, dicho curso si bien no se presentaron la cantidad de personas que seria lo deseado realmente el equipo que participo y los profesionales realmente excelente, de una calidez humana mejor imposible . Cada encuentro fue un disfrute y no lo digo por mi propia experiencia hablo por todos los que participamos ; ´si bien me falta mas de la mitad de mis años de años de antiguedad para jubilarme me sirvio para ver con otros ojos mi vida particular, ustedes no tienen idea de lo especial que fue para mi este curso.Pase por 3 psicologos con tratamientos intensivos pero sin un resultado positivo  pero con este curso logre el 1000 x 1000 de la comprensión de la existencia del ser y su entorno .Hemos disfrutado de este curso como si durante esas 2 horas hubieramos viajado por playas exóticas , rodeados de nuestros seres queridos alejados de todos los problemas y volviamos a nuestras rutinas diarias con una paz incomparable indiscreptible .-Los felicito y les agradecería tuvieran a bien el poder hacer llegar mis felicitaciones a la CDORA GAMÓN , desde ya muchas gracias por permitirme participar y formar parte de tan prestigiosa institución ; me tomo el atreviemitno diciento eso pues desde hace 2 años concuroo a cuanto curso se me autorice cursar .-\r\nSaludos coordiales y felicitaciones por semejante equipo de trabajo.-'),
